public class ProtobufProxy implements Proxy {
  @Override public void connect(  String serverAddress,  int port) throws InterruptedException {
    EventLoopGroup group=new NioEventLoopGroup();
    try {
      Bootstrap bootstrap=new Bootstrap().group(group).channel(NioSocketChannel.class).handler(new ChannelInitializer<SocketChannel>(){
        @Override protected void initChannel(        SocketChannel ch) throws Exception {
          ch.pipeline().addLast(new IdleStateHandler(0,4,0,TimeUnit.SECONDS)).addLast(new ProtobufVarint32FrameDecoder()).addLast(new ProtobufDecoder(ClientTransferData.ClientTransferDataProtoc.getDefaultInstance())).addLast(new ProtobufVarint32LengthFieldPrepender()).addLast(new ProtobufEncoder()).addLast(new SecondProtobufCodec()).addLast(new ProtobufTransferHandler());
        }
      }
);
      SimplePrinter.printNotice("Connecting to " + serverAddress + ":"+ port);
      Channel channel=bootstrap.connect(serverAddress,port).sync().channel();
      channel.closeFuture().sync();
    }
  finally {
      group.shutdownGracefully().sync();
    }
  }
}

