          threeStartIndex=index;
        }
        threeEndIndex=index;
        threeCount++;
      }
 else       if (value == 4) {
        if (fourStartIndex == -1) {
          fourStartIndex=index;
        }
        fourEndIndex=index;
        fourCount++;
      }
    }
