        for (        ClientSide client : room.getClientSideList()) {
          if (client.getRole() == ClientRole.PLAYER) {
            ChannelUtils.pushToClient(client.getChannel(),ClientEventCode.CODE_GAME_LANDLORD_CYCLE,null);
          }
        }
        ServerEventListener.get(ServerEventCode.CODE_GAME_STARTING).call(clientSide,null);
        return;
      }
 else {
        room.setBaseScore(highestScore);
        int landlordId=(Integer)map.get("currentLandlordId");
        for (        ClientSide client : room.getClientSideList())         if (client.getId() == landlordId) {
          confirmLandlord(client,room);
          return;
        }
      }
    }
    ClientSide turnClientSide=clientSide.getNext();
    room.setCurrentSellClient(turnClientSide.getId());
    String result;
    if (highestScore != 0) {
      result=MapHelper.newInstance().put("roomId",room.getId()).put("roomOwner",room.getRoomOwner()).put("roomClientCount",room.getClientSideList().size()).put("preClientNickname",clientSide.getNickname()).put("preClientId",clientSide.getId()).put("nextClientNickname",turnClientSide.getNickname()).put("nextClientId",turnClientSide.getId()).put("highestScore",highestScore).put("currentLandlordId",(Integer)map.get("currentLandlordId")).json();
    }
 else {
      result=MapHelper.newInstance().put("roomId",room.getId()).put("roomOwner",room.getRoomOwner()).put("roomClientCount",room.getClientSideList().size()).put("preClientNickname",clientSide.getNickname()).put("nextClientNickname",turnClientSide.getNickname()).put("nextClientId",turnClientSide.getId()).put("highestScore",0).json();
    }
    for (    ClientSide client : room.getClientSideList()) {
      if (client.getRole() == ClientRole.PLAYER) {
        ChannelUtils.pushToClient(client.getChannel(),ClientEventCode.CODE_GAME_LANDLORD_ELECT,result);
        continue;
      }
      if (client.getId() == turnClientSide.getId()) {
        RobotEventListener.get(ClientEventCode.CODE_GAME_LANDLORD_ELECT).call(client,result);
      }
    }
    notifyWatcherRobLandlord(room,clientSide);
  }
  public void confirmLandlord(  ClientSide clientSide,  Room room){
    clientSide.getPokers().addAll(room.getLandlordPokers());
    PokerHelper.sortPoker(clientSide.getPokers());
