    room.setCurrentSellClient(currentClientId);
    clientSide.setType(ClientType.LANDLORD);
    for (    ClientSide client : room.getClientSideList()) {
      String result=MapHelper.newInstance().put("roomId",room.getId()).put("roomOwner",room.getRoomOwner()).put("roomClientCount",room.getClientSideList().size()).put("landlordNickname",clientSide.getNickname()).put("landlordId",clientSide.getId()).put("additionalPokers",room.getLandlordPokers()).put("baseScore",room.getBaseScore()).json();
