public class ServerEventListener_CODE_GAME_POKER_PLAY_REDIRECT implements ServerEventListener {
  @Override public void call(  ClientSide clientSide,  String data){
    Room room=ServerContains.getRoom(clientSide.getRoomId());
    Map<String,Object> datas=new HashMap<String,Object>();
    if (StringUtils.isNotBlank(data)) {
      datas=Noson.parseMap(data);
    }
    List<Map<String,Object>> clientInfos=new ArrayList<Map<String,Object>>(3);
    for (    ClientSide client : room.getClientSideList()) {
      if (clientSide.getId() != client.getId()) {
        clientInfos.add(MapHelper.newInstance().put("clientId",client.getId()).put("clientNickname",client.getNickname()).put("type",client.getType()).put("surplus",client.getPokers().size()).put("position",clientSide.getPre().getId() == client.getId() ? "UP" : "DOWN").map());
      }
    }
    List<List<Poker>> lastPokerList=new ArrayList<>();
    for (int i=0; i < room.getClientSideList().size(); i++) {
      if (room.getClientSideList().get(i).getId() != clientSide.getId()) {
        lastPokerList.add(room.getClientSideList().get(i).getPokers());
      }
    }
    String lastPokers=LastCardsUtils.getLastCards(lastPokerList);
    lastPokerList=new ArrayList<>();
    String result=MapHelper.newInstance().put("pokers",clientSide.getPokers()).put("lastSellPokers",datas.get("lastSellPokers")).put("lastSellClientId",datas.get("lastSellClientId")).put("clientInfos",clientInfos).put("sellClientId",room.getCurrentSellClient()).put("sellClientNickname",ServerContains.CLIENT_SIDE_MAP.get(room.getCurrentSellClient()).getNickname()).put("lastPokers",lastPokers).json();
    ChannelUtils.pushToClient(clientSide.getChannel(),ClientEventCode.CODE_GAME_POKER_PLAY_REDIRECT,result);
  }
}

